import React from 'react'
import Layout from '../../components/MyLayout'
import axios from 'axios';

export default class Registration extends React.Component {
    state = {
        location_info:{
            name: '',
            region: '',
            address: '',
            phone: '',
            web: '',
            geo: '',
        },
        payment_info: {
            motorcycle: [0,0],
            car : [0,0],
            rv : [0,0]
        }
    }

    handleLocationInfoChange = event => {
        const {location_info} = {...this.state};
        const currentState = location_info;
        const { name, value } = e.target;
        currentState[name] = value;
        this.setState({ location_info : currentState });
    }
    handlePaymentInfoChange = event => {
        const {payment_info} = {...this.state};
        const currentState = location_info;
        const { name, value } = e.target;
        currentState[name] = value;
        this.setState({ location_info : currentState });
    }

    handleSubmit = event => {
        event.preventDefault();

        const user = {
            name: this.state.name,

        };

        axios.post(`http://localhost/parkpay/parks`,{user})
        .then(res => {

        })
    }

    render(){
        return(
            <Layout>
                <div>
                    <h1>Register new park</h1>
                <form onSubmit={this.handleSubmit}>
                <label>
                    Person Name:
                    <input type="text" name="name" value={this.state.location_info.name} onChange={this.handleLocationInfoChange} />
                </label>
                <label>
                    Region :
                    <input type="text" name="region" value={this.state.location_info.address} onChange={this.handleLocationInfoChange} />
                </label>
                <button type="submit">Add</button>
                </form>
            </div> 
          </Layout>
        )
    }

}
